                              vi_ruc              IN VARCHAR2,
                              vo_result          OUT SYS_REFCURSOR) AS
  BEGIN
  
    IF vi_codigo_empresa = 0 THEN
      OPEN vo_result FOR
        SELECT CODIGO_EMPRESA, RUC, RAZON_SOCIAL, CONDICION, ESTADO 
        FROM SIS_EMPRESA 
        WHERE ESTADO = 1 AND RUC = vi_ruc;
        
    ELSE
      OPEN vo_result FOR
