    IF vi_codigo_empresa = 0 THEN
        
        SELECT SEQ_SIS_CODIGO_EMPRESA.NEXTVAL INTO vl_codigo FROM DUAL;
        VALUES (vl_codigo, vi_ruc, UPPER(vi_razon_social), 'ACTIVO', 1, vi_codigo_usuario, SYSDATE, null, null);
        
        vo_codigo_empresa := vl_codigo;
        vo_indicador := '00';
        vo_mensaje := 'Se registro satisfactoriamente la empresa.';
    ELSE
    
        UPDATE sis_empresa
        SET
        ruc = vi_ruc, 
        razon_social = UPPER(vi_razon_social),
        usuario_modifica = vi_codigo_usuario, 
        fecha_modifica = SYSDATE
        WHERE usuario_registra = vi_codigo_usuario
        AND codigo_empresa = vi_codigo_empresa;
        
        vo_codigo_empresa := vi_codigo_empresa;
        vo_indicador := '00';
        vo_mensaje := 'Se modifico satisfactoriamente la empresa.';
        
    END IF;
  
  EXCEPTION 
    WHEN OTHERS THEN
      vo_codigo_empresa := 0;
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
