  vl_codigo                 NUMBER;                              
  BEGIN
  
  
    IF vi_codigo_egreso = 0 THEN
    
        SELECT SEQ_SIS_CODIGO_EGRESO.NEXTVAL INTO vl_codigo FROM DUAL;
        VALUES (vl_codigo, vi_tipo_documento, vi_numero_documento, to_date(vi_fecha,'DD/MM/YYYY'), vi_codigo_empresa, upper(vi_detalle), vi_total, upper(vi_representante), 1, vi_codigo_usuario, SYSDATE, null, null, upper(vi_cobrado), vi_dni, upper(vi_area), vi_tipo_categoria);
        
        vo_codigo_egreso := vl_codigo;
        vo_indicador := '00';
        vo_mensaje := 'Se registro satisfactoriamente los Egresos ingresados.';
        
    ELSE
    
        UPDATE sis_egreso
        SET
