      vo_codigo_egreso := 0;
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
      ROLLBACK;  
      
  END SP_GRABAR_EGRESO;

-- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_REPORTE_EGRESO(vi_pagina                 IN  NUMBER,
                              vi_registros              IN  NUMBER,
                              vi_codigo_egreso          IN  VARCHAR,
                              vo_total_registros        OUT NUMBER,
                              vo_result                 OUT SYS_REFCURSOR) AS
  vl_inicio NUMBER;
  vl_fin    NUMBER;                              
  BEGIN
    
    vl_fin := vi_pagina * vi_registros;
    vl_inicio := vl_fin - (vi_registros - 1);
    
    dbms_output.put_line ('INICIO : ' || vl_inicio); 
    dbms_output.put_line ('FIN : ' || vl_fin); 
    
    IF vi_codigo_egreso = '0' THEN
    
        SELECT COUNT(*) INTO vo_total_registros
        FROM SIS_EGRESO p 
        WHERE p.ESTADO = 1;
        
        OPEN vo_result FOR
            SELECT codigo_egreso, tipo_documento, numero_documento, fecha, codigo_empresa, detalle, total, representante, estado, nombre_documento, ruc, razon_social, cobrado, dni, area, tipo_categoria
            FROM (
                SELECT codigo_egreso, tipo_documento, numero_documento, fecha, codigo_empresa, detalle, total, representante, estado, nombre_documento, ruc, razon_social, cobrado, dni, area, tipo_categoria, ROWNUM numfila
                FROM (
                      SELECT p.codigo_egreso, p.tipo_documento, p.numero_documento, to_char(p.fecha,'DD/MM/YYYY') fecha, p.codigo_empresa, p.detalle, p.total, NVL(p.representante,'--') representante, p.estado, c.nombre_concepto nombre_documento, e.ruc, e.razon_social, NVL(p.cobrado,'--') cobrado, NVL(p.dni,'--') dni, NVL(p.area,'--') area, p.tipo_categoria
                      FROM SIS_EGRESO p 
                        INNER JOIN SIS_CONCEPTO c ON c.CODIGO_CONCEPTO = p.TIPO_DOCUMENTO
                        INNER JOIN SIS_EMPRESA e ON e.CODIGO_EMPRESA = p.CODIGO_EMPRESA
                      WHERE p.estado in (1,2)
                      ORDER BY p.rowid
                ) A
            ) B
            WHERE numfila BETWEEN vl_inicio AND vl_fin;
            
    ELSE
    
        SELECT COUNT(*) INTO vo_total_registros
        FROM SIS_EGRESO p
        WHERE p.codigo_egreso = vi_codigo_egreso AND p.ESTADO=1;
        
        OPEN vo_result FOR
            SELECT codigo_egreso, tipo_documento, numero_documento, fecha, codigo_empresa, detalle, total, representante, estado, nombre_documento, ruc, razon_social, cobrado, dni, area, tipo_categoria
            FROM (
                SELECT codigo_egreso, tipo_documento, numero_documento, fecha, codigo_empresa, detalle, total, representante, estado, nombre_documento, ruc, razon_social, cobrado, dni, area, tipo_categoria, ROWNUM numfila
                FROM (
                      SELECT p.codigo_egreso, p.tipo_documento, p.numero_documento, to_char(p.fecha,'DD/MM/YYYY') fecha, p.codigo_empresa, p.detalle, p.total, NVL(p.representante,'--') representante, p.estado, c.nombre_concepto nombre_documento, e.ruc, e.razon_social, NVL(p.cobrado,'--') cobrado, NVL(p.dni,'--') dni, NVL(p.area,'--') area, tipo_categoria
                      FROM SIS_EGRESO p 
                        INNER JOIN SIS_CONCEPTO c ON c.CODIGO_CONCEPTO = p.TIPO_DOCUMENTO
                        INNER JOIN SIS_EMPRESA e ON e.CODIGO_EMPRESA = p.CODIGO_EMPRESA
                      WHERE p.codigo_egreso = vi_codigo_egreso and p.estado in (1,2)
                      ORDER BY p.FECHA, p.CODIGO_EGRESO
                ) A
            ) B
            WHERE numfila BETWEEN vl_inicio AND vl_fin;
        
    END IF;
  END SP_REPORTE_EGRESO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_ELIMINAR_EGRESO(vi_codigo_egreso            IN NUMBER,
                               vi_codigo_usuario           IN NUMBER,
                               vo_indicador                OUT VARCHAR,
                               vo_mensaje                  OUT VARCHAR) AS
  BEGIN
    
    UPDATE SIS_EGRESO
    SET
    estado = 0, 
    usuario_modifica = vi_codigo_usuario, 
    fecha_modifica = SYSDATE
    WHERE codigo_egreso = vi_codigo_egreso;
        
    vo_indicador := '00';
    vo_mensaje := 'Se elimino el recibo ' || vi_codigo_egreso || ' satisfactoriamente.';
  
  EXCEPTION 
    WHEN OTHERS THEN
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
      ROLLBACK;  
      
  END SP_ELIMINAR_EGRESO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_ANULAR_EGRESO(vi_codigo_egreso            IN NUMBER,
                               vi_motivo_anulacion         IN VARCHAR,
                               vi_codigo_usuario           IN NUMBER,
                               vo_indicador                OUT VARCHAR,
                               vo_mensaje                  OUT VARCHAR) AS
  BEGIN
    
    UPDATE SIS_EGRESO
    SET
    estado = 2, 
    observaciones = upper(vi_motivo_anulacion),
    usuario_modifica = vi_codigo_usuario, 
    fecha_modifica = SYSDATE
    WHERE codigo_egreso = vi_codigo_egreso;
        
    vo_indicador := '00';
    vo_mensaje := 'Se anuló el recibo ' || vi_codigo_egreso || ' satisfactoriamente.';
  
  EXCEPTION 
    WHEN OTHERS THEN
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
      ROLLBACK;  
      
  END SP_ANULAR_EGRESO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --  
  PROCEDURE SP_REPORTE_EGRESO_EXCEL(vi_pagina                  IN  NUMBER,
                              vi_registros              IN  NUMBER,
                              vi_exportar               IN  NUMBER,
                              vo_total_registros        OUT NUMBER,
                              vo_result                 OUT SYS_REFCURSOR) AS
  vl_inicio NUMBER;
  vl_fin    NUMBER;                              
  BEGIN
    
    vl_fin := vi_pagina * vi_registros;
    vl_inicio := vl_fin - (vi_registros - 1);
    
    dbms_output.put_line ('INICIO : ' || vl_inicio); 
    dbms_output.put_line ('FIN : ' || vl_fin); 
    
    IF vi_exportar = 1 THEN
        
        --vo_total_registros := 1;
        SELECT COUNT(1) INTO vo_total_registros
        FROM sis_egreso s
        WHERE s.ESTADO = 1;
        
        
        OPEN vo_result FOR
          SELECT s.TIPO_DOCUMENTO, c.NOMBRE_CONCEPTO NOMBRE_DOCUMENTO, s.NUMERO_DOCUMENTO, TO_CHAR(s.FECHA,'DD/MM/YYYY') FECHA, s.DETALLE, /*TO_CHAR (s.TOTAL,'FM9G999G999D00') TOTAL,*/ s.TOTAL, s.REPRESENTANTE, e.RUC, e.RAZON_SOCIAL, to_char(s.FECHA_CREA ,'DD/MM/YYYY') AS FECHA_INGRESO, s.ESTADO, s.OBSERVACIONES
          FROM sis_egreso s
            INNER JOIN sis_concepto c ON c.CODIGO_CONCEPTO = s.TIPO_DOCUMENTO
            INNER JOIN sis_empresa e ON e.CODIGO_EMPRESA = s.CODIGO_EMPRESA
          WHERE s.ESTADO in (1,2)
          ORDER BY s.FECHA_CREA;
            
    ELSE
        IF vi_exportar = '0' THEN
        
            SELECT COUNT(*) INTO vo_total_registros
            FROM sis_socio s
            LEFT JOIN sis_giro_comercial g ON s.codigo_giro = g.codigo_giro;
            
            OPEN vo_result FOR
                SELECT codigo_socio, nro_puesto, codigo_giro, dni, nombre_full, nombre_giro, padron, fecha_ingreso, nombre_sector
                FROM (
                    SELECT codigo_socio, nro_puesto, codigo_giro, dni, nombre_full, nombre_giro, padron, fecha_ingreso, nombre_sector, ROWNUM numfila
                    FROM (
                    
                          SELECT s.codigo_socio, s.nro_puesto, s.codigo_giro, s.dni, s.apellido_paterno || ' ' || s.apellido_materno || ', ' || s.nombres AS nombre_full, g.nombre_giro, s.padron,
                          TO_CHAR(s.fecha_ingreso, 'DD/MM/YYYY') AS fecha_ingreso, s.nombre_sector
                          FROM sis_socio s
                          LEFT JOIN sis_giro_comercial g ON s.codigo_giro = g.codigo_giro
                          LEFT JOIN sis_sector s ON g.codigo_sector = s.codigo_sector
                          WHERE s.estado = 1
                          
                    ) A
                ) B
                WHERE numfila BETWEEN vl_inicio AND vl_fin;
        
        END IF;
    END IF;
    
  END SP_REPORTE_EGRESO_EXCEL;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --                            
  PROCEDURE SP_FACTURACION(vi_codigo_facturacion        IN  NUMBER,
                           vo_codigo_usuario            OUT  NUMBER,
                           vo_serie                     OUT  VARCHAR,
                           vo_secuencia                 OUT  VARCHAR,
                           vo_result                    OUT SYS_REFCURSOR) AS
  BEGIN
      
      SELECT codigo_usuario, serie, secuencia INTO vo_codigo_usuario, vo_serie, vo_secuencia 
      FROM sis_facturacion_cab WHERE estado = 1 AND codigo_facturacion_cab = vi_codigo_facturacion; 
      
      OPEN vo_result FOR
        SELECT codigo_facturacion_det, codigo_deuda_socio, monto 
        FROM sis_facturacion_det WHERE codigo_facturacion_cab = vi_codigo_facturacion;
      
  END SP_FACTURACION;

END PKG_FACTURACION;

