    vo_indicador := '00';
    vo_mensaje := 'Se elimino el puesto.';
  
  EXCEPTION 
    WHEN OTHERS THEN
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
      ROLLBACK;  
      
  END SP_ELIMINAR_PUESTO;
