--------------------------------------------------------

  CREATE OR REPLACE PACKAGE BODY "JAMBROCIO"."PKG_RECIBO_AGUA" 
AS
 
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_REPORTE_PUESTO_AGUA(vi_pagina            IN  NUMBER,
                              vi_registros              IN  NUMBER,
                              vi_codigo_recibo          IN  NUMBER,
                              vo_total_registros        OUT NUMBER,
                              vo_result                 OUT SYS_REFCURSOR) AS

  vl_inicio NUMBER;
  vl_fin    NUMBER;                              
  BEGIN
  
    vl_fin := vi_pagina * vi_registros;
    vl_inicio := vl_fin - (vi_registros - 1);
    
    dbms_output.put_line ('INICIO : ' || vl_inicio); 
    dbms_output.put_line ('FIN : ' || vl_fin); 
    
    IF vi_codigo_recibo = '0' THEN

        SELECT count(*) INTO vo_total_registros 
        FROM SIS_RECIBO_AGUA;
       
        OPEN vo_result FOR
            SELECT B.codigoRecibo, B.lecturaInicial,	B.lecturaFinal,	B.monto,	B.periodo,	B.estado
            FROM (
                SELECT A.codigo_recibo_agua codigoRecibo, A.num_lectura_inicial lecturaInicial,	A.num_lectura_final lecturaFinal,	A.num_monto monto,	A.fec_periodo periodo,	A.num_estado estado, ROWNUM numfila
                FROM (
                      SELECT codigo_recibo_agua, num_lectura_inicial, num_lectura_final, num_monto, fec_periodo, num_estado
                      FROM SIS_RECIBO_AGUA
                      WHERE num_estado = 1
                ) A
            ) B
            WHERE numfila BETWEEN vl_inicio AND vl_fin;

      
    END IF;
                              
  END SP_REPORTE_PUESTO_AGUA;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_GRABAR_RECIBO_AGUA(vi_codigo_recibo      IN NUMBER,
                             vi_lectura_inicial         IN NUMBER,
                             vi_lectura_final           IN NUMBER,
                             vi_monto                   IN NUMBER,
                             vi_periodo                 IN VARCHAR2,
                             vi_codigo_usuario          IN NUMBER,
                             vo_codigo_recibo           OUT NUMBER,
                             vo_indicador               OUT VARCHAR,
                             vo_mensaje                 OUT VARCHAR) AS
                             
  vl_codigo                 NUMBER;
  vl_total_periodo          NUMBER;
  BEGIN
        
    IF vi_codigo_recibo = 0 THEN
    
        SELECT COUNT(1) INTO vl_total_periodo FROM SIS_RECIBO_AGUA WHERE FEC_PERIODO = upper(vi_periodo) AND NUM_ESTADO = 1;
    
        IF vl_total_periodo = 0 THEN
        
          SELECT SQ_RECIBO_AGUA.NEXTVAL INTO vl_codigo FROM DUAL;
          VALUES (vl_codigo, vi_lectura_inicial, vi_lectura_final, vi_monto, upper(vi_periodo), 1, vi_codigo_usuario, SYSDATE, null, null);
          
          vo_codigo_recibo := vl_codigo;
          vo_indicador := '00';
          vo_mensaje := 'Se registro satisfactoriamente el recibo.';
        
        ELSE

          vo_codigo_recibo := 0;
          vo_indicador := '01';
          vo_mensaje := 'No se registro el recibo porque el periodo: ' || upper(vi_periodo) || ' ya existe.';
          
        END IF;

        
        
    ELSE
    
        UPDATE SIS_RECIBO_AGUA
        SET
        num_lectura_inicial = vi_lectura_inicial,
        num_lectura_final = vi_lectura_final,
        num_monto = vi_monto,
        fec_periodo = vi_periodo,
        usuario_modifica = vi_codigo_usuario, 
        fecha_modifica = SYSDATE
        WHERE codigo_recibo_agua = vi_codigo_recibo;
        
        vo_codigo_recibo := vi_codigo_recibo;
        vo_indicador := '00';
        vo_mensaje := 'Se modifico satisfactoriamente el recibo.';
    END IF;
    
  END SP_GRABAR_RECIBO_AGUA;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_ELIMINAR_RECIBO_AGUA(vi_codigo_recibo       IN NUMBER,
                               vi_codigo_usuario           IN NUMBER,
                               vo_indicador                OUT VARCHAR,
                               vo_mensaje                  OUT VARCHAR) AS
  BEGIN
    
    UPDATE SIS_RECIBO_AGUA
    SET
    num_estado = 0, 
    usuario_modifica = vi_codigo_usuario, 
    fecha_modifica = SYSDATE
    WHERE codigo_recibo_agua = vi_codigo_recibo;
        
    vo_indicador := '00';
    vo_mensaje := 'Se elimino el recibo ' || vi_codigo_recibo || ' satisfactoriamente.';
  
  EXCEPTION 
    WHEN OTHERS THEN
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
      ROLLBACK;  
      
  END SP_ELIMINAR_RECIBO_AGUA;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  
END PKG_RECIBO_AGUA;

