                            se.CODIGO_SECTOR, se.NOMBRE_SECTOR, so.ESTADO ESTADOSOCIO, so.PADRON, so.CODIGO_GIRO, sg.NOMBRE_GIRO, vi_codigo_recibo CODIGO_RECIBO_AGUA,
                            nvl(FN_RECIBO_AGUA_CREADO(so.CODIGO_SOCIO,vi_codigo_recibo,'L'),0) recibo_agua_creado,
