                        INNER JOIN SIS_SOCIO_SERVICIO se ON se.CODIGO_SERVICIO_DETALLE = sd.CODIGO_SERVICIO_DETALLE
                        INNER JOIN SIS_SOCIO so ON so.CODIGO_SOCIO = se.CODIGO_SOCIO
                        INNER JOIN SIS_GIRO_COMERCIAL sg ON sg.CODIGO_GIRO = so.CODIGO_GIRO
                        INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = sg.CODIGO_SECTOR
                      WHERE s.CODIGO_SERVICIO = 2 AND s.ESTADO = 1
