                    nvl(FN_RECIBO_AGUA_CREADO(s.CODIGO_SOCIO,vi_codigo_agua_original,'L'),0) recibo_agua_creado,
                    nvl(FN_RECIBO_AGUA_CREADO(s.CODIGO_SOCIO,vi_codigo_agua_original,'T'),0) total,
                    (SELECT FEC_PERIODO FROM SIS_RECIBO_AGUA WHERE CODIGO_RECIBO_AGUA = vi_codigo_agua_original) PERIODO_SOCIO,
                    (SELECT ESTADO_ABIERTO FROM SIS_RECIBO_AGUA WHERE CODIGO_RECIBO_AGUA = vi_codigo_agua_original) ESTADO_ABIERTO
                    FROM SIS_SOCIO_SERVICIO ss 
