                    GROUP BY ss.CODIGO_SOCIO, se.CODIGO_SECTOR, se.NOMBRE_SECTOR, s.CODIGO_SOCIO, s.APELLIDO_PATERNO, s.APELLIDO_MATERNO, s.nombres, s.NRO_PUESTO, gc.NOMBRE_GIRO
