                      INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
                      INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR
                    WHERE ss.CODIGO_SERVICIO_DETALLE IN (2,3) AND gc.CODIGO_SECTOR = vi_codigo_sector AND s.NRO_PUESTO = vi_nro_puesto
                    GROUP BY ss.CODIGO_SOCIO, se.CODIGO_SECTOR, se.NOMBRE_SECTOR, s.CODIGO_SOCIO, s.APELLIDO_PATERNO, s.APELLIDO_MATERNO, s.nombres, s.NRO_PUESTO, gc.NOMBRE_GIRO
