        FROM (
              SELECT l.ID_RECIBO, l.CORRELATIVO, l.CODIGO_SOCIO, l.CODIGO_RECIBO, (s.APELLIDO_PATERNO || ' ' || s.APELLIDO_MATERNO || ',' || s.NOMBRES) NOMBREFULL, g.CODIGO_GIRO, g.NOMBRE_GIRO, ss.CODIGO_SECTOR, ss.NOMBRE_SECTOR, r.FEC_PERIODO, l.LECTURA_INICIAL, l.LECTURA_FINAL, l.CONSUMO_MES, l.MANTENIMIENTO, l.DEUDA_ANTERIOR, l.RECONEXION, l.TOTAL, s.NRO_PUESTO, l.TRABADO, r.ESTADO_ABIERTO, l.ALCANTARILLADO
              FROM SIS_RECIBO_AGUA_SOCIO l
                INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = l.CODIGO_SOCIO
                INNER JOIN SIS_GIRO_COMERCIAL g ON g.CODIGO_GIRO = s.CODIGO_GIRO
                INNER JOIN SIS_SECTOR ss ON ss.CODIGO_SECTOR = g.CODIGO_SECTOR
                INNER JOIN SIS_RECIBO_AGUA r ON r.CODIGO_RECIBO_AGUA = l.CODIGO_RECIBO
              WHERE s.NRO_PUESTO = vi_puesto_socio  AND l.CODIGO_RECIBO = vi_codigo_recibo
              ) A
        ) B
     WHERE numfila BETWEEN vl_inicio AND vl_fin;
        
    --END IF;
    
  END SP_EDITAR_AGUA_X_SOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --

  
END PKG_RECIBO_AGUA_SOCIO;

