  PROCEDURE SP_REPORTE_LUZ_ORIG(vi_pagina               IN  NUMBER,
                              vi_registros              IN  NUMBER,
                              vi_codigo_recibo_luz_orig IN  VARCHAR,
                              vo_total_registros        OUT NUMBER,
                              vo_result                 OUT SYS_REFCURSOR) AS
  vl_inicio NUMBER;
  vl_fin    NUMBER;                              
  BEGIN
    
    vl_fin := vi_pagina * vi_registros;
    vl_inicio := vl_fin - (vi_registros - 1);
    
    dbms_output.put_line ('INICIO : ' || vl_inicio); 
    dbms_output.put_line ('FIN : ' || vl_fin); 
    
    IF vi_codigo_recibo_luz_orig = '0' THEN
    
        SELECT COUNT(*) INTO vo_total_registros
        FROM SIS_RECIBO_LUZ p;
        
        OPEN vo_result FOR
            SELECT cod_orgrecibo_luz codigoReciboLuzOriginal, fec_periodo periodo, fecemision fecEmision, fecvencimiento fecVencimiento, totalmesact totalMesAct, deudaanterior, ( nvl(totalMesAct,0) + nvl(aporteley,0) + nvl(deudaanterior,0) + nvl(recargomora,0) + nvl(redonmesant,0) + nvl(redonmesact,0) ) total, estado_abierto
            FROM (
                SELECT cod_orgrecibo_luz, fec_periodo, fecemision, fecvencimiento, totalmesact, aporteley, deudaanterior, recargomora, redonmesant, redonmesact, estado_abierto, ROWNUM numfila
                FROM (
                      SELECT cod_orgrecibo_luz, fec_periodo, fecemision, fecvencimiento, totalmesact, aporteley, deudaanterior, recargomora, redonmesant, redonmesact, estado_abierto
                      FROM SIS_RECIBO_LUZ p
                ) A
            ) B
            WHERE numfila BETWEEN vl_inicio AND vl_fin;
            
    ELSE
    
        SELECT COUNT(*) INTO vo_total_registros
        FROM SIS_RECIBO_LUZ p
        WHERE p.cod_orgrecibo_luz = vi_codigo_recibo_luz_orig;
        
        OPEN vo_result FOR
            SELECT cod_orgrecibo_luz codigoReciboLuzOriginal, fec_periodo periodo, fecemision fecEmision, fecvencimiento fecVencimiento, totalmesact totalMesAct, deudaanterior, ( nvl(totalMesAct,0) + nvl(aporteley,0) + nvl(deudaanterior,0) + nvl(recargomora,0) + nvl(redonmesant,0) + nvl(redonmesact,0) ) total, estado_abierto
            FROM (
                SELECT cod_orgrecibo_luz, fec_periodo, fecemision, fecvencimiento, totalmesact, aporteley, deudaanterior, recargomora, redonmesant, redonmesact, estado_abierto, ROWNUM numfila
                FROM (
                      SELECT cod_orgrecibo_luz, fec_periodo, fecemision, fecvencimiento, totalmesact, aporteley, deudaanterior, recargomora, redonmesant, redonmesact, estado_abierto
                      FROM SIS_RECIBO_LUZ p
                      WHERE p.cod_orgrecibo_luz = vi_codigo_recibo_luz_orig
                ) A
            ) B
            WHERE numfila BETWEEN vl_inicio AND vl_fin;
        
    END IF;
  END SP_REPORTE_LUZ_ORIG;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_REPORTE_CERRAR_LUZ_ORIG(vi_codigo_recibo_luz_orig IN  NUMBER,
                                      vo_codigo_recibo       OUT NUMBER,
                                      vo_indicador           OUT VARCHAR,
                                      vo_mensaje             OUT VARCHAR)AS
  BEGIN
  
    UPDATE SIS_RECIBO_LUZ SET ESTADO_ABIERTO = 1
    WHERE COD_ORGRECIBO_LUZ = vi_codigo_recibo_luz_orig;
        
    vo_codigo_recibo := vi_codigo_recibo_luz_orig;
    vo_indicador := '00';
    vo_mensaje := 'Se CERRÓ satisfactoriamente el Recibo de Luz Original cuyo código es ' || vi_codigo_recibo_luz_orig ;
    
    EXCEPTION 
      WHEN OTHERS THEN
        vo_codigo_recibo := 0;
        vo_indicador := '01';
        vo_mensaje := SQLCODE || ' - ' || SQLERRM;
        ROLLBACK;
  END SP_REPORTE_CERRAR_LUZ_ORIG;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --

END PKG_RECIBO_LUZ_ORIG;

