  CREATE OR REPLACE PACKAGE BODY "JAMBROCIO"."PKG_RECIBO_LUZ_SOCIO" 
AS

  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_GRABAR_LUZ_X_SOCIO(vi_idrecibo            IN NUMBER,
                             vi_codigo_socio             IN NUMBER,
                             vi_codigo_recibo            IN NUMBER,
                             vi_correlativo              IN NUMBER,
                             vi_lectura_inicial          IN NUMBER,
                             vi_lectura_final            IN VARCHAR,
                             vi_consumo_mes              IN NUMBER,
                             vi_cargo_energia            IN NUMBER,
                             vi_alumbrado_publico        IN NUMBER,
                             vi_servicio_mantenimiento   IN NUMBER,
                             vi_deuda_anterior           IN NUMBER,
                             vi_reconexion               IN NUMBER,
                             vi_total                    IN NUMBER,
                             vi_estado                   IN NUMBER,
                             vi_trabado                  IN NUMBER,
                             vi_usuario_carga            IN VARCHAR2,
                             vi_fecha_carga              IN DATE,
                             vi_usuario_modifica         IN VARCHAR2,
                             vi_fecha_modifica           IN DATE,
                             vo_codigo_socio             OUT NUMBER,
                             vo_indicador                OUT VARCHAR,
                             vo_mensaje                  OUT VARCHAR) AS
  
  vl_codigo                 NUMBER;
  vl_fec_periodo            VARCHAR2(20);
  BEGIN
    
    IF vi_correlativo = 0 THEN
        
        SELECT SQ_RECIBO_LUZ_SOCIO.NEXTVAL INTO vl_codigo FROM DUAL;
        SELECT fec_periodo INTO vl_fec_periodo FROM sis_recibo_luz WHERE cod_orgrecibo_luz = vi_codigo_recibo;
        
        VALUES (vi_idrecibo, vi_codigo_socio, vi_codigo_recibo, vl_codigo, vi_lectura_inicial, vi_lectura_final, vi_consumo_mes, vi_cargo_energia, vi_alumbrado_publico, vi_servicio_mantenimiento, vi_deuda_anterior, vi_reconexion, vi_total, 1, 0, vi_usuario_carga, SYSDATE, null, null, vi_trabado);
        
        --REGISTRO DE DEUDAS DEL SOCIO
        VALUES(SEQ_SIS_DEUDA_SOCIO.NEXTVAL, 4, vi_total, vl_fec_periodo, vi_codigo_socio, 1);
        
        vo_codigo_socio := vl_codigo;
        vo_indicador := '00';
        vo_mensaje := 'Se registro satisfactoriamente el recibo de luz x socio.';
   
    ELSE
    
        UPDATE sis_recibo_luz_socio
        SET
          idrecibo = vi_idrecibo,
          lecturainicial = vi_lectura_inicial, 
          lecturafinal = vi_lectura_final, 
          consumomes = vi_consumo_mes, 
          cargoenergia = vi_cargo_energia, 
          alumbradopublico = vi_alumbrado_publico, 
          mantenimiento = vi_servicio_mantenimiento, 
          deudaanterior = vi_deuda_anterior, 
          reconexion = vi_reconexion, 
          total = vi_total,
          trabado = vi_trabado,
          usuariomodifica = vi_usuario_carga, 
          fechamodifica = SYSDATE        
        WHERE correlativo = vi_correlativo;
        
        --REGISTRO DE DEUDAS DEL SOCIO
        UPDATE sis_deuda_socio
        SET
          importe = vi_total
        WHERE codigo_socio = vi_codigo_socio AND codigo_servicio_detalle = 4;
        
        
        vo_codigo_socio := vi_codigo_socio;
        vo_indicador := '00';
        vo_mensaje := 'Se modifico satisfactoriamente el recibo de luz x socio.';
        
    END IF;
  
  EXCEPTION 
    WHEN OTHERS THEN
      vo_codigo_socio := 0;
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
      ROLLBACK;  
    
  END SP_GRABAR_LUZ_X_SOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_ELIMINAR_LUZ_X_SOCIO(vi_codigo_socio       IN NUMBER,
                             vi_codigo_recibo             IN NUMBER,
                             vi_codigo_usuario            IN NUMBER,
                             vo_indicador                 OUT VARCHAR,
                             vo_mensaje                   OUT VARCHAR) AS
  BEGIN
    
    UPDATE sis_recibo_luz_socio
    SET
    estado = 2, 
    usuariomodifica = vi_codigo_usuario, 
    fechamodifica = SYSDATE
    WHERE codigosocio = vi_codigo_socio and codigorecibo = vi_codigo_recibo;
        
    vo_indicador := '00';
    vo_mensaje := 'Se elimino el Recibo de Luz.';
  
  EXCEPTION 
    WHEN OTHERS THEN
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
      ROLLBACK;  
      
  END SP_ELIMINAR_LUZ_X_SOCIO;
