  PROCEDURE SP_REPORTE_PUESTO_LUZ_SOCIO(vi_pagina       IN  NUMBER,
                              vi_registros              IN  NUMBER,
                              vi_codigo_puesto          IN  VARCHAR2,
                              vi_codigo_luz_original    IN  NUMBER,
                              vo_total_registros        OUT NUMBER,
                              vo_result                 OUT SYS_REFCURSOR) AS
  vl_inicio NUMBER;
  vl_fin    NUMBER;                              
  BEGIN
    
    vl_fin := vi_pagina * vi_registros;
    vl_inicio := vl_fin - (vi_registros - 1);
    
    dbms_output.put_line ('INICIO : ' || vl_inicio); 
    dbms_output.put_line ('FIN : ' || vl_fin); 
    
    IF vi_codigo_puesto = '0' THEN
    
        SELECT COUNT(*) INTO vo_total_registros
        FROM SIS_SOCIO_SERVICIO ss 
          INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = ss.CODIGO_SOCIO
          INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
          INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR
          WHERE s.ESTADO = 1 AND ss.CODIGO_SERVICIO_DETALLE=4;
        
        OPEN vo_result FOR
            SELECT B.ESTADORECIBOLUZ, B.CODIGORECIBOORIGINAL, B.CODIGOSECTOR, B.NOMBRESECTOR, B.CODIGO_SOCIO, B.NOMBREFULL, B.NROPUESTO, B.NOMBREGIRO, B.CODIGO_SERVICIO_DETALLE, 
              CASE WHEN (B.ESTADORECIBOLUZ=2) THEN 0 ELSE B.recibo_luz_creado END recibo_luz_creado, 
              CASE WHEN (B.ESTADORECIBOLUZ=2) THEN 0 ELSE B.TOTAL END total
            FROM (            
                  SELECT A.ESTADO ESTADORECIBOLUZ, A.CODIGORECIBOORIGINAL, A.CODIGOSECTOR, A.NOMBRESECTOR, A.CODIGO_SOCIO, A.NOMBREFULL, A.NROPUESTO, A.NOMBREGIRO, A.CODIGO_SERVICIO_DETALLE, A.recibo_luz_creado, A.total, ROWNUM numfila
                  FROM (
                      SELECT vi_codigo_luz_original CODIGORECIBOORIGINAL, se.CODIGO_SECTOR CODIGOSECTOR, se.NOMBRE_SECTOR NOMBRESECTOR, s.CODIGO_SOCIO, concat(concat(concat(concat(s.APELLIDO_PATERNO, ' '),s.APELLIDO_MATERNO), ','),s.nombres) NOMBREFULL, s.NRO_PUESTO NROPUESTO, gc.NOMBRE_GIRO NOMBREGIRO, ss.CODIGO_SERVICIO_DETALLE
                      --SELECT vi_codigo_luz_original CODIGORECIBOORIGINAL, s.CODIGO_SOCIO CODIGOSECTOR, se.NOMBRE_SECTOR NOMBRESECTOR, s.CODIGO_SOCIO, concat(concat(concat(concat(s.APELLIDO_PATERNO, ' '),s.APELLIDO_MATERNO), ','),s.nombres) NOMBREFULL, s.NRO_PUESTO NROPUESTO, gc.NOMBRE_GIRO NOMBREGIRO, ss.CODIGO_SERVICIO_DETALLE
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'L'),0) recibo_luz_creado
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'T'),0) total
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'E'),0) estado
                      FROM SIS_SOCIO_SERVICIO ss 
                        INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = ss.CODIGO_SOCIO
                        INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
                        INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR
                      WHERE ss.CODIGO_SERVICIO_DETALLE = 4
                      ) A
                 ) B
            WHERE numfila BETWEEN vl_inicio AND vl_fin;
            
    ELSE
    
        SELECT COUNT(*) INTO vo_total_registros
        FROM SIS_SOCIO_SERVICIO ss 
          INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = ss.CODIGO_SOCIO
          INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
          INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR
        WHERE s.ESTADO = 1 AND ss.CODIGO_SERVICIO_DETALLE=4 AND s.NRO_PUESTO = ''' || vi_codigo_puesto || ''' ;
        
        OPEN vo_result FOR
            SELECT B.ESTADORECIBOLUZ, B.CODIGORECIBOORIGINAL, B.CODIGOSECTOR, B.NOMBRESECTOR, B.CODIGO_SOCIO, B.NOMBREFULL, B.NROPUESTO, B.NOMBREGIRO, B.CODIGO_SERVICIO_DETALLE, 
              CASE WHEN (B.ESTADORECIBOLUZ=2) THEN 0 ELSE B.recibo_luz_creado END recibo_luz_creado, 
              CASE WHEN (B.ESTADORECIBOLUZ=2) THEN 0 ELSE B.TOTAL END total
            FROM (            
                  SELECT A.ESTADO ESTADORECIBOLUZ, A.CODIGORECIBOORIGINAL, A.CODIGOSECTOR, A.NOMBRESECTOR, A.CODIGO_SOCIO, A.NOMBREFULL, A.NROPUESTO, A.NOMBREGIRO, A.CODIGO_SERVICIO_DETALLE, A.recibo_luz_creado, A.total, ROWNUM numfila
                  FROM (
                      SELECT vi_codigo_luz_original CODIGORECIBOORIGINAL, se.CODIGO_SECTOR CODIGOSECTOR, se.NOMBRE_SECTOR NOMBRESECTOR, s.CODIGO_SOCIO, concat(concat(concat(concat(s.APELLIDO_PATERNO, ' '),s.APELLIDO_MATERNO), ','),s.nombres) NOMBREFULL, s.NRO_PUESTO NROPUESTO, gc.NOMBRE_GIRO NOMBREGIRO, ss.CODIGO_SERVICIO_DETALLE
                      --SELECT vi_codigo_luz_original CODIGORECIBOORIGINAL, s.CODIGO_SOCIO CODIGOSECTOR, se.NOMBRE_SECTOR NOMBRESECTOR, s.CODIGO_SOCIO, concat(concat(concat(concat(s.APELLIDO_PATERNO, ' '),s.APELLIDO_MATERNO), ','),s.nombres) NOMBREFULL, s.NRO_PUESTO NROPUESTO, gc.NOMBRE_GIRO NOMBREGIRO, ss.CODIGO_SERVICIO_DETALLE
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'L'),0) recibo_luz_creado
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'T'),0) total
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'E'),0) estado
                      FROM SIS_SOCIO_SERVICIO ss 
                        INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = ss.CODIGO_SOCIO
                        INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
                        INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR                        
                      WHERE ss.CODIGO_SERVICIO_DETALLE = 4 AND s.NRO_PUESTO = vi_codigo_puesto
                      ) A
                 ) B
            WHERE numfila BETWEEN vl_inicio AND vl_fin;
        
    END IF;
  END SP_REPORTE_PUESTO_LUZ_SOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_EDITAR_LUZ_X_SOCIO(vi_pagina             IN  NUMBER,
                             vi_registros               IN  NUMBER,
                             vi_puesto_socio            IN VARCHAR2,
                             vi_codigo_recibo           IN NUMBER,
                             vi_codigo_usuario          IN NUMBER,
                             vo_total_registros         OUT NUMBER,
                             vo_result                  OUT SYS_REFCURSOR) AS
                             
  vl_inicio NUMBER;
  vl_fin    NUMBER;  
  BEGIN
    vl_fin := vi_pagina * vi_registros;
    vl_inicio := vl_fin - (vi_registros - 1);
    
    dbms_output.put_line ('INICIO : ' || vl_inicio); 
    dbms_output.put_line ('FIN : ' || vl_fin); 
    
    --IF vi_codigo_recibo <> '0' THEN
    
      SELECT count(*) INTO vo_total_registros
      FROM SIS_RECIBO_LUZ_SOCIO l
        INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = l.CODIGOSOCIO
      WHERE s.NRO_PUESTO = vi_puesto_socio AND l.CODIGORECIBO = vi_codigo_recibo;
      
      OPEN vo_result FOR

     SELECT B.IDRECIBO, B.CORRELATIVO, B.CODIGOSOCIO, B.CODIGORECIBO, B.NOMBREFULL, B.NOMBRE_GIRO, B.NOMBRE_SECTOR, B.FEC_PERIODO, B.LECTURAINICIAL, B.LECTURAFINAL, B.CONSUMOMES, B.CARGOENERGIA, B.ALUMBRADOPUBLICO, B.SERVICIOMANTENIMIENTO, B.DEUDAANTERIOR, B.RECONEXION, B.TOTAL, B.PUESTOSOCIO, B.COSTOWATTS, B.TRABADO, B.ESTADO_ABIERTO
     FROM (      
        SELECT A.IDRECIBO, A.CORRELATIVO, A.CODIGOSOCIO, A.CODIGORECIBO, A.NOMBREFULL, A.NOMBRE_GIRO, A.NOMBRE_SECTOR, A.FEC_PERIODO, A.LECTURAINICIAL, A.LECTURAFINAL, A.CONSUMOMES, A.CARGOENERGIA, A.ALUMBRADOPUBLICO, A.MANTENIMIENTO SERVICIOMANTENIMIENTO, A.DEUDAANTERIOR, A.RECONEXION, A.TOTAL, A.NRO_PUESTO PUESTOSOCIO, A.NUM_COSTO_WATS COSTOWATTS, A.TRABADO, A.ESTADO_ABIERTO, ROWNUM numfila
        FROM (
              SELECT l.IDRECIBO, l.CORRELATIVO, l.CODIGOSOCIO, l.CODIGORECIBO, (s.APELLIDO_PATERNO || ' ' || s.APELLIDO_MATERNO || ',' || s.NOMBRES) NOMBREFULL, g.NOMBRE_GIRO, ss.NOMBRE_SECTOR, r.FEC_PERIODO, l.LECTURAINICIAL, l.LECTURAFINAL, l.CONSUMOMES, l.CARGOENERGIA, l.ALUMBRADOPUBLICO, l.MANTENIMIENTO, l.DEUDAANTERIOR, l.RECONEXION, l.TOTAL, s.NRO_PUESTO, r.NUM_COSTO_WATS, l.TRABADO, r.ESTADO_ABIERTO
              FROM SIS_RECIBO_LUZ_SOCIO l
                INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = l.CODIGOSOCIO
                INNER JOIN SIS_GIRO_COMERCIAL g ON g.CODIGO_GIRO = s.CODIGO_GIRO
                INNER JOIN SIS_SECTOR ss ON ss.CODIGO_SECTOR = g.CODIGO_SECTOR
                INNER JOIN SIS_RECIBO_LUZ r ON r.COD_ORGRECIBO_LUZ = l.CODIGORECIBO
              WHERE s.NRO_PUESTO = vi_puesto_socio  AND l.CODIGORECIBO = vi_codigo_recibo
              ) A
        ) B
     WHERE numfila BETWEEN vl_inicio AND vl_fin;
        
    --END IF;
    
  END SP_EDITAR_LUZ_X_SOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_REPORTE_PUESTO_X_LUZSOCIO(vi_pagina      IN  NUMBER,
                              vi_registros              IN  NUMBER,
                              vi_codigo_sector          IN  NUMBER,
                              vi_nro_puesto             IN VARCHAR2,
                              vi_codigo_luz_original    IN  NUMBER,
                              vo_total_registros        OUT NUMBER,
                              vo_result                 OUT SYS_REFCURSOR) AS
  vl_inicio NUMBER;
  vl_fin    NUMBER;                              
  BEGIN
    
    vl_fin := vi_pagina * vi_registros;
    vl_inicio := vl_fin - (vi_registros - 1);
    
    dbms_output.put_line ('INICIO : ' || vl_inicio); 
    dbms_output.put_line ('FIN : ' || vl_fin); 
    
    IF vi_codigo_sector = '0' THEN
    
        SELECT COUNT(*) INTO vo_total_registros
        FROM SIS_SOCIO_SERVICIO ss 
          INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = ss.CODIGO_SOCIO
          INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
          INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR;     
        
        OPEN vo_result FOR
          SELECT B.CODIGOSOCIO, B.CODIGORECIBOORIGINAL, B.CODIGOSECTOR, B.NOMBRESECTOR, B.CODIGO_SOCIO, B.NOMBREFULL, B.NROPUESTO, B.NOMBREGIRO, B.CODIGO_SERVICIO_DETALLE, B.recibo_luz_creado, B.total, B.PERIODOSOCIO, B.ALUMBRADOPUBLICO, B.MANTENIMIENTO, B.NUMCOSTOWATTS, B.ESTADO_ABIERTO
          FROM (            
                SELECT A.CODIGOSOCIO, A.CODIGORECIBOORIGINAL, A.CODIGOSECTOR, A.NOMBRESECTOR, A.CODIGO_SOCIO, A.NOMBREFULL, A.NROPUESTO, A.NOMBREGIRO, A.CODIGO_SERVICIO_DETALLE, A.recibo_luz_creado, A.total, A.PERIODOSOCIO, A.ALUMBRADOPUBLICO, A.MANTENIMIENTO, A.NUMCOSTOWATTS, A.ESTADO_ABIERTO, ROWNUM numfila
                FROM (
                    SELECT ss.CODIGO_SOCIO CODIGOSOCIO, vi_codigo_luz_original CODIGORECIBOORIGINAL, se.CODIGO_SECTOR CODIGOSECTOR, se.NOMBRE_SECTOR NOMBRESECTOR, s.CODIGO_SOCIO, concat(concat(concat(concat(s.APELLIDO_PATERNO, ' '),s.APELLIDO_MATERNO), ','),s.nombres) NOMBREFULL, s.NRO_PUESTO NROPUESTO, gc.NOMBRE_GIRO NOMBREGIRO, ss.CODIGO_SERVICIO_DETALLE
                    , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'L'),0) recibo_luz_creado
                    , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'T'),0) total,
                    (SELECT FEC_PERIODO FROM SIS_RECIBO_LUZ WHERE COD_ORGRECIBO_LUZ = vi_codigo_luz_original) PERIODOSOCIO,
                    (SELECT ALUMBRADOPUBLICO FROM SIS_RECIBO_LUZ WHERE COD_ORGRECIBO_LUZ = vi_codigo_luz_original) ALUMBRADOPUBLICO,
                    (SELECT MANTENIMIENTO FROM SIS_RECIBO_LUZ WHERE COD_ORGRECIBO_LUZ = vi_codigo_luz_original) MANTENIMIENTO,
                    (SELECT NUM_COSTO_WATS FROM SIS_RECIBO_LUZ WHERE COD_ORGRECIBO_LUZ = vi_codigo_luz_original) NUMCOSTOWATTS,
                    (SELECT ESTADO_ABIERTO FROM SIS_RECIBO_LUZ WHERE COD_ORGRECIBO_LUZ = vi_codigo_luz_original) ESTADO_ABIERTO
                    FROM SIS_SOCIO_SERVICIO ss 
                      INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = ss.CODIGO_SOCIO
                      INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
                      INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR
                    WHERE ss.CODIGO_SERVICIO_DETALLE = 4
                    ) A
               ) B
          WHERE numfila BETWEEN vl_inicio AND vl_fin;
            
    ELSE
    
        SELECT COUNT(*) INTO vo_total_registros
        FROM SIS_SOCIO_SERVICIO ss 
          INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = ss.CODIGO_SOCIO
          INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
          INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR
        WHERE se.CODIGO_SECTOR = vi_codigo_sector;
        
        OPEN vo_result FOR
          SELECT B.CODIGOSOCIO, B.CODIGORECIBOORIGINAL, B.CODIGOSECTOR, B.NOMBRESECTOR, B.CODIGO_SOCIO, B.NOMBREFULL, B.NROPUESTO, B.NOMBREGIRO, B.CODIGO_SERVICIO_DETALLE, B.recibo_luz_creado, B.total, B.PERIODOSOCIO, B.ALUMBRADOPUBLICO, B.MANTENIMIENTO, B.NUMCOSTOWATTS, B.ESTADO_ABIERTO
          FROM (            
                SELECT A.CODIGOSOCIO, A.CODIGORECIBOORIGINAL, A.CODIGOSECTOR, A.NOMBRESECTOR, A.CODIGO_SOCIO, A.NOMBREFULL, A.NROPUESTO, A.NOMBREGIRO, A.CODIGO_SERVICIO_DETALLE, A.recibo_luz_creado, A.total, A.PERIODOSOCIO, A.ALUMBRADOPUBLICO, A.MANTENIMIENTO, A.NUMCOSTOWATTS, A.ESTADO_ABIERTO, ROWNUM numfila
                FROM (
                    SELECT ss.CODIGO_SOCIO CODIGOSOCIO, vi_codigo_luz_original CODIGORECIBOORIGINAL, se.CODIGO_SECTOR CODIGOSECTOR, se.NOMBRE_SECTOR NOMBRESECTOR, s.CODIGO_SOCIO, concat(concat(concat(concat(s.APELLIDO_PATERNO, ' '),s.APELLIDO_MATERNO), ','),s.nombres) NOMBREFULL, s.NRO_PUESTO NROPUESTO, gc.NOMBRE_GIRO NOMBREGIRO, ss.CODIGO_SERVICIO_DETALLE
                    , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'L'),0) recibo_luz_creado
                    , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'T'),0) total,
                    (SELECT FEC_PERIODO FROM SIS_RECIBO_LUZ WHERE COD_ORGRECIBO_LUZ = vi_codigo_luz_original) PERIODOSOCIO,
                    (SELECT ALUMBRADOPUBLICO FROM SIS_RECIBO_LUZ WHERE COD_ORGRECIBO_LUZ = vi_codigo_luz_original) ALUMBRADOPUBLICO,
                    (SELECT MANTENIMIENTO FROM SIS_RECIBO_LUZ WHERE COD_ORGRECIBO_LUZ = vi_codigo_luz_original) MANTENIMIENTO,
                    (SELECT NUM_COSTO_WATS FROM SIS_RECIBO_LUZ WHERE COD_ORGRECIBO_LUZ = vi_codigo_luz_original) NUMCOSTOWATTS,
                    (SELECT ESTADO_ABIERTO FROM SIS_RECIBO_LUZ WHERE COD_ORGRECIBO_LUZ = vi_codigo_luz_original) ESTADO_ABIERTO
                    FROM SIS_SOCIO_SERVICIO ss 
                      INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = ss.CODIGO_SOCIO
                      INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
                      INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR                        
                    WHERE gc.CODIGO_SECTOR = vi_codigo_sector AND s.NRO_PUESTO = vi_nro_puesto AND ss.CODIGO_SERVICIO_DETALLE = 4
                    ) A
               ) B
          WHERE numfila BETWEEN vl_inicio AND vl_fin;
        
        
    END IF;
  END SP_REPORTE_PUESTO_X_LUZSOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --  
END PKG_RECIBO_LUZ_SOCIO;

/
--------------------------------------------------------
--  DDL for Package Body PKG_SOCIO
--------------------------------------------------------

  CREATE OR REPLACE PACKAGE BODY "JAMBROCIO"."PKG_SOCIO" AS
  
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_REPORTE_SOCIO(vi_pagina                  IN  NUMBER,
                              vi_registros              IN  NUMBER,
                              vi_dni                    IN  VARCHAR,
                              vi_nombre                 IN  VARCHAR,
                              vi_exportar               IN  NUMBER,
                              vo_total_registros        OUT NUMBER,
                              vo_result                 OUT SYS_REFCURSOR) AS
  vl_inicio NUMBER;
  vl_fin    NUMBER;                              
  BEGIN
    
    vl_fin := vi_pagina * vi_registros;
    vl_inicio := vl_fin - (vi_registros - 1);
    
    dbms_output.put_line ('INICIO : ' || vl_inicio); 
    dbms_output.put_line ('FIN : ' || vl_fin); 
    
    IF vi_exportar = 1 THEN
        
        vo_total_registros := 1;
        
        OPEN vo_result FOR
            SELECT s.codigo_socio, s.nro_puesto, s.codigo_giro, s.dni, s.apellido_paterno || ' ' || s.apellido_materno || ', ' || s.nombres AS nombre_full, g.nombre_giro, s.padron,
            TO_CHAR(s.fecha_ingreso, 'DD/MM/YYYY') AS fecha_ingreso, s.nombre_sector
            FROM sis_socio s
            LEFT JOIN sis_giro_comercial g ON s.codigo_giro = g.codigo_giro
            LEFT JOIN sis_sector s ON g.codigo_sector = s.codigo_sector
            WHERE s.estado = 1;
            
    ELSE
        IF vi_dni = '0' THEN
        
            SELECT COUNT(*) INTO vo_total_registros
            FROM sis_socio s
            LEFT JOIN sis_giro_comercial g ON s.codigo_giro = g.codigo_giro;
            
            OPEN vo_result FOR
                SELECT codigo_socio, nro_puesto, codigo_giro, dni, nombre_full, nombre_giro, padron, fecha_ingreso, nombre_sector
                FROM (
                    SELECT codigo_socio, nro_puesto, codigo_giro, dni, nombre_full, nombre_giro, padron, fecha_ingreso, nombre_sector, ROWNUM numfila
                    FROM (
                    
                          SELECT s.codigo_socio, s.nro_puesto, s.codigo_giro, s.dni, s.apellido_paterno || ' ' || s.apellido_materno || ', ' || s.nombres AS nombre_full, g.nombre_giro, s.padron,
                          TO_CHAR(s.fecha_ingreso, 'DD/MM/YYYY') AS fecha_ingreso, s.nombre_sector
                          FROM sis_socio s
                          LEFT JOIN sis_giro_comercial g ON s.codigo_giro = g.codigo_giro
                          LEFT JOIN sis_sector s ON g.codigo_sector = s.codigo_sector
                          WHERE s.estado = 1
                          
                    ) A
                ) B
                WHERE numfila BETWEEN vl_inicio AND vl_fin;
        
        ELSE
        
            IF LENGTH(TRIM(vi_nombre)) > 0 THEN
                SELECT COUNT(*) INTO vo_total_registros
                FROM sis_socio s
                LEFT JOIN sis_giro_comercial g ON s.codigo_giro = g.codigo_giro
                WHERE concat(concat(concat(concat(s.APELLIDO_PATERNO, ' '),s.apellido_materno),' '),s.nombres) like '''%' || vi_nombre || '%''';
                
                OPEN vo_result FOR
                    SELECT codigo_socio, nro_puesto, codigo_giro, dni, nombre_full, nombre_giro, padron, fecha_ingreso, nombre_sector
                    FROM (
                        SELECT codigo_socio, nro_puesto, codigo_giro, dni, nombre_full, nombre_giro, padron, fecha_ingreso, nombre_sector, ROWNUM numfila
                        FROM (
                        
                              SELECT s.codigo_socio, s.nro_puesto, s.codigo_giro, s.dni, s.apellido_paterno || ' ' || s.apellido_materno || ', ' || s.nombres AS nombre_full, g.nombre_giro, s.padron,
                              TO_CHAR(s.fecha_ingreso, 'DD/MM/YYYY') AS fecha_ingreso, s.nombre_sector
                              FROM sis_socio s
                              LEFT JOIN sis_giro_comercial g ON s.codigo_giro = g.codigo_giro
                              LEFT JOIN sis_sector s ON g.codigo_sector = s.codigo_sector
                              WHERE s.estado = 1
                              
                        ) A 
                        WHERE NOMBRE_FULL LIKE upper('%' || vi_nombre || '%')
                    ) B
                    WHERE numfila BETWEEN vl_inicio AND vl_fin;
              ELSE
            
                  SELECT COUNT(*) INTO vo_total_registros
                  FROM sis_socio s
                  LEFT JOIN sis_giro_comercial g ON s.codigo_giro = g.codigo_giro
                  WHERE s.dni = vi_dni;
                    
                  OPEN vo_result FOR
                      SELECT codigo_socio, nro_puesto, codigo_giro, dni, nombre_full, nombre_giro, padron, fecha_ingreso, nombre_sector
                      FROM (
                          SELECT codigo_socio, nro_puesto, codigo_giro, dni, nombre_full, nombre_giro, padron, fecha_ingreso, nombre_sector, ROWNUM numfila
                          FROM (
                          
                                SELECT s.codigo_socio, s.nro_puesto, s.codigo_giro, s.dni, s.apellido_paterno || ' ' || s.apellido_materno || ', ' || s.nombres AS nombre_full, g.nombre_giro, s.padron,
                                TO_CHAR(s.fecha_ingreso, 'DD/MM/YYYY') AS fecha_ingreso, s.nombre_sector
                                FROM sis_socio s
                                LEFT JOIN sis_giro_comercial g ON s.codigo_giro = g.codigo_giro
                                LEFT JOIN sis_sector s ON g.codigo_sector = s.codigo_sector
                                WHERE s.dni = vi_dni
                                AND s.estado = 1
                                
                          ) A
                      ) B
                      WHERE numfila BETWEEN vl_inicio AND vl_fin;
                END IF;
            
        END IF;
    END IF;
    
  END SP_REPORTE_SOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_BUSCAR_SOCIO(vi_codigo_socio           IN  NUMBER,
                            vo_result                 OUT SYS_REFCURSOR) AS
  BEGIN
      
      OPEN vo_result FOR
          SELECT s.codigo_socio, s.nro_puesto, s.codigo_giro, s.dni, s.apellido_paterno, s.apellido_materno, s.nombres, g.nombre_giro, s.telefono, s.celular, TO_CHAR(fecha_nacimiento, 'DD/MM/YYYY') AS fecha_nacimiento,
          TO_CHAR(fecha_ingreso, 'DD/MM/YYYY') AS fecha_ingreso, s.padron
          FROM sis_socio s
          LEFT JOIN sis_giro_comercial g ON s.codigo_giro = g.codigo_giro
          WHERE s.codigo_socio = vi_codigo_socio;
      
  END SP_BUSCAR_SOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_BUSCAR_SOCIO_PUESTO(vi_numero_puesto       IN  VARCHAR,
                                   vo_result              OUT SYS_REFCURSOR) AS
  BEGIN
      
      OPEN vo_result FOR
          SELECT s.codigo_socio, s.nro_puesto, s.codigo_giro, s.dni, s.apellido_paterno, s.apellido_materno, s.nombres, g.nombre_giro, s.telefono, s.celular, TO_CHAR(fecha_nacimiento, 'DD/MM/YYYY') AS fecha_nacimiento,
          TO_CHAR(fecha_ingreso, 'DD/MM/YYYY') AS fecha_ingreso, s.padron, se.nombre_sector
          FROM sis_socio s
          LEFT JOIN sis_giro_comercial g ON s.codigo_giro = g.codigo_giro
          LEFT JOIN sis_sector se ON g.codigo_sector = se.codigo_sector
          WHERE s.nro_puesto = vi_numero_puesto;
      
  END SP_BUSCAR_SOCIO_PUESTO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_GRABAR_SOCIO(vi_codigo_socio             IN NUMBER,
                            vi_dni                      IN VARCHAR,
                            vi_apellido_paterno         IN VARCHAR,
                            vi_apellido_materno         IN VARCHAR,
                            vi_nombres                  IN VARCHAR,
                            vi_fec_nac                  IN VARCHAR,
                            vi_fec_ingreso              IN VARCHAR,
                            vi_correo                   IN VARCHAR,
                            vi_telefono                 IN VARCHAR,
                            vi_celular                  IN VARCHAR,
                            vi_codigo_giro              IN NUMBER,
                            vi_nro_puesto               IN VARCHAR,
                            vi_padron                   IN VARCHAR,
                            vi_codigo_usuario_registro  IN NUMBER,
                            vo_codigo_socio             OUT NUMBER,
                            vo_indicador                OUT VARCHAR,
                            vo_mensaje                  OUT VARCHAR) AS
  vl_codigo                 NUMBER;
  vl_existe_dni             NUMBER;
  vl_existe_padron          NUMBER;
  vl_existe_puesto          NUMBER;
  
  vl_dni                    VARCHAR(8);
  vl_padron                 VARCHAR(4);
  vl_puesto                 VARCHAR(4);
  
  vl_error                  NUMBER;
  BEGIN
    
    vl_error := 0;
    SELECT COUNT(*) INTO vl_existe_dni FROM sis_socio WHERE dni = vi_dni AND estado = 1;
    SELECT COUNT(*) INTO vl_existe_padron FROM sis_socio WHERE padron = vi_padron AND estado = 1;
    SELECT COUNT(*) INTO vl_existe_puesto FROM sis_socio WHERE nro_puesto = vi_nro_puesto AND estado = 1;
    
    IF vi_codigo_socio = 0 THEN
        
        IF vl_existe_dni > 0 THEN
            vo_mensaje := 'El DNI ya se encuentra registrado.';
            vl_error := 1;
        END IF;
        
        IF vl_existe_padron > 0 THEN
            vo_mensaje := 'El Nro. de Padron ya se encuentra registrado';
            vl_error := 1;
        END IF;
        
        IF vl_existe_puesto > 0 THEN
            vo_mensaje := 'El Nro. de Puesto ya se encuentra registrado';
            vl_error := 1;
        END IF;    
        
        IF vl_error = 0 THEN
            SELECT SEQ_SIS_SOCIO.NEXTVAL INTO vl_codigo FROM DUAL;
            padron, fecha_ingreso)
            VALUES (vl_codigo, vi_dni, vi_nro_puesto, vi_apellido_paterno, vi_apellido_materno, vi_nombres, vi_fec_nac, vi_correo, vi_telefono, vi_celular, 1, vi_codigo_usuario_registro, SYSDATE, vi_codigo_giro,
            vi_padron, vi_fec_ingreso);
            
            vo_codigo_socio := vl_codigo;
            vo_indicador := '00';
            vo_mensaje := 'Se registro satisfactoriamente el socio.';
        ELSE
            vo_codigo_socio := 0;
            vo_indicador := '01';
        END IF;
    ELSE
        
        SELECT dni, padron, nro_puesto INTO vl_dni, vl_padron, vl_puesto FROM sis_socio WHERE codigo_socio = vi_codigo_socio AND estado = 1;
        
        IF vl_dni != vi_dni THEN
            IF vl_existe_dni > 0 THEN
                vo_mensaje := 'El DNI ya se encuentra registrado.';
                vl_error := 1;
            END IF;
        END IF;
        
        IF vl_padron != vi_padron THEN
            IF vl_existe_padron > 0 THEN
                vo_mensaje := 'El Nro. de Padron ya se encuentra registrado';
                vl_error := 1;
            END IF;
        END IF;
        
        IF vl_puesto != vi_nro_puesto THEN
            IF vl_existe_puesto > 0 THEN
                vo_mensaje := 'El Nro. de Puesto ya se encuentra registrado';
                vl_error := 1;
            END IF;
        END IF;
        
        IF vl_error = 0 THEN
            UPDATE sis_socio
            SET
            dni = vi_dni, 
            nro_puesto = vi_nro_puesto, 
            apellido_paterno = vi_apellido_paterno, 
            apellido_materno = vi_apellido_materno, 
            nombres = vi_nombres, 
            fecha_nacimiento = vi_fec_nac, 
            correo = vi_correo, 
            telefono = vi_telefono, 
            celular = vi_celular, 
            codigo_giro = vi_codigo_giro,
            padron = vi_padron, 
            fecha_ingreso = vi_fec_ingreso,
            usuario_modificacion = vi_codigo_usuario_registro, 
            fecha_modificacion = SYSDATE
            WHERE codigo_socio = vi_codigo_socio;
            
            vo_codigo_socio := vi_codigo_socio;
            vo_indicador := '00';
            vo_mensaje := 'Se modifico satisfactoriamente el socio.';
        ELSE
            vo_codigo_socio := 0;
            vo_indicador := '01';
        END IF;
    END IF;
  
  EXCEPTION 
    WHEN OTHERS THEN
      vo_codigo_socio := 0;
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
      ROLLBACK;  
      
  END SP_GRABAR_SOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_ELIMINAR_SOCIO(vi_codigo_socio             IN NUMBER,
                              vi_codigo_usuario           IN NUMBER,
                              vo_indicador                OUT VARCHAR,
                              vo_mensaje                  OUT VARCHAR) AS
  BEGIN
  
    UPDATE sis_socio
    SET
    estado = 0, 
    usuario_modificacion = vi_codigo_usuario, 
    fecha_modificacion = SYSDATE
    WHERE codigo_socio = vi_codigo_socio;
        
    vo_indicador := '00';
    vo_mensaje := 'Se elimino el socio.';
  
  EXCEPTION 
    WHEN OTHERS THEN
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
      ROLLBACK;  
      
  END SP_ELIMINAR_SOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_LISTA_OPCIONES_SERVICIOS(vi_codigo_socio    IN  NUMBER,
                                        vo_result          OUT SYS_REFCURSOR) AS
  BEGIN
      IF vi_codigo_socio = 0 THEN
          OPEN vo_result FOR
              SELECT s.codigo_servicio, s.nombre_servicio, s.orden AS orden_servicio, d.codigo_servicio_detalle, d.nombre_detalle, d.importe, d.obligatorio, d.orden AS orden_detalle,
              CASE WHEN d.obligatorio = 1 THEN 1 ELSE 0 END AS seleccionado 
              FROM sis_servicio s
              LEFT JOIN sis_servicio_detalle d ON s.codigo_servicio = d.codigo_servicio
              WHERE s.estado = 1
              AND d.estado = 1
              ORDER BY s.orden, d.orden;
      ELSE
          OPEN vo_result FOR
              SELECT s.codigo_servicio, s.nombre_servicio, s.orden AS orden_servicio, d.codigo_servicio_detalle, d.nombre_detalle, d.importe, d.obligatorio, d.orden AS orden_detalle,
              CASE WHEN d.obligatorio = 1 THEN 1 ELSE 
                  CASE WHEN (SELECT COUNT(*) FROM sis_socio_servicio ss WHERE ss.codigo_socio = vi_codigo_socio AND ss.codigo_servicio_detalle = d.codigo_servicio_detalle) = 0 THEN 0 ELSE 1 END
              END AS seleccionado 
              FROM sis_servicio s
              LEFT JOIN sis_servicio_detalle d ON s.codigo_servicio = d.codigo_servicio
              WHERE s.estado = 1
              AND d.estado = 1
              ORDER BY s.orden, d.orden;
      END IF;
  END SP_LISTA_OPCIONES_SERVICIOS;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_GRABAR_SOCIO_SERVICIO(vi_codigo_socio                IN NUMBER,
                                     vi_codigo_servicio_detalle     IN NUMBER) AS
  vl_codigo                 NUMBER;                                     
  BEGIN
      
      SELECT SEQ_SIS_SOCIO_SERVICIO.NEXTVAL INTO vl_codigo FROM DUAL;
      VALUES(vl_codigo, vi_codigo_servicio_detalle, vi_codigo_socio);
  
  EXCEPTION 
    WHEN OTHERS THEN
      ROLLBACK;  
      
  END SP_GRABAR_SOCIO_SERVICIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_ELIMINAR_SOCIO_SERVICIO(vi_codigo_socio                IN NUMBER) AS
  BEGIN
      
      DELETE FROM sis_socio_servicio WHERE codigo_socio = vi_codigo_socio;
      COMMIT;
      
  END SP_ELIMINAR_SOCIO_SERVICIO;

  
END PKG_SOCIO;

